import React from 'react';

class DisplayPokemon extends React.Component {
    render() {
        return(
            <div>{() => {
                this.props.pokemon.map(pokemonElement => <div>{pokemonElement.name}</div>)
            }}</div>
        );
    }
}

export default DisplayPokemon;
